Description:
SPLIT LEVEL LIVING AT ITS BEST!
"Enjoy this near-new home in classy Grandvue"
Located in one of Officer's premier locations. The Grandvue estate has quickly built a reputation for delivering stylish homes and a first-class lifestyle. Close to parks, schools (both primary and secondary), public transport and shops this property is central to all amenities.
The property includes:
- Timber flooring throughout and carpet to bedrooms;
- Master bedroom with walk through robe to the ensuite, ensuite with large vanity;
- Open plan kitchen, dining and living area;
- Kitchen complete with 900ml stove and oven, dishwasher and microwave, Cesar stone bench tops;
- Remaining 3 bedrooms with built in robes;
- Children's retreat;
- Spacious family bathroom with bath tub;
- Laundry complete with broom closet,separate linen cupboard ;
- Ducted heating;
- Alfresco;
- Double garage with remote and internal and rear access;
- Fully landscaped.
